import React from "react";
import ListItem from "../ListItem/ListItem";
import requests from "../../requests";
import "./List.scss";

export default function List() {
  return (
    <div>
      <div>
      <span>Continue to watch</span>
      <div>
        <ListItem fetchUrl={requests.fetchComedyMovies} />
      </div>
      </div>
    </div>
  );
}
